import { Button, Heading, Input, Text } from "@chakra-ui/react";

const App = () => {
	return (
		<div className="min-h-screen flex items-center justify-center bg-gray-100">
			<div className="max-w-sm w-full bg-white p-8 rounded shadow-lg">
				<Heading size="lg">Онлайн чат</Heading>
				<div className="mb-4">
					<Text fontSize={"sm"}>Имя пользователя</Text>
					<Input name="username" placeholder="Введите ваше имя" />
				</div>
				<div className="mb-6">
					<Text fontSize={"sm"}>Имя пользователя</Text>
					<Input name="chatname" placeholder="Введите название чата" />
				</div>
				<Button colorScheme="blue">Присоединиться</Button>
			</div>
		</div>
	);
};

export default App;
